No puedo identificar con certeza la continuación exacta de este poema. Parece ser un fragmento de un soneto con una estructura métrica clásica, posiblemente de corte simbolista o modernista, pero no puedo asegurar cómo continúa el texto. Los versos que me has proporcionado sugieren una reflexión sobre la extinción de la luz, el paso del tiempo y los recuerdos, pero sin más contexto no puedo completar el poema.
